public class InnerRuleGroupRuleFactory(Action<Humidifier.WAFv2.RuleGroupTypes.Rule> factoryAction = null) : SubResourceFactory<Humidifier.WAFv2.RuleGroupTypes.Rule>
{

    internal InnerRuleGroupRuleActionFactory ActionFactory { get; set; }

    internal InnerRuleGroupStatementFactory StatementFactory { get; set; }

    internal InnerRuleGroupChallengeConfigFactory ChallengeConfigFactory { get; set; }

    internal InnerRuleGroupVisibilityConfigFactory VisibilityConfigFactory { get; set; }

    internal InnerRuleGroupCaptchaConfigFactory CaptchaConfigFactory { get; set; }

    protected override Humidifier.WAFv2.RuleGroupTypes.Rule Create()
    {
        var ruleResult = CreateRule();
        factoryAction?.Invoke(ruleResult);

        return ruleResult;
    }

    private Humidifier.WAFv2.RuleGroupTypes.Rule CreateRule()
    {
        var ruleResult = new Humidifier.WAFv2.RuleGroupTypes.Rule();

        return ruleResult;
    }
    public override void CreateChildren(Humidifier.WAFv2.RuleGroupTypes.Rule result)
    {
        base.CreateChildren(result);

        result.Action ??= ActionFactory?.Build();
        result.Statement ??= StatementFactory?.Build();
        result.ChallengeConfig ??= ChallengeConfigFactory?.Build();
        result.VisibilityConfig ??= VisibilityConfigFactory?.Build();
        result.CaptchaConfig ??= CaptchaConfigFactory?.Build();
    }

} // End Of Class

